import React from 'react';

function About() {
  return (
    <div className="celestial-bg celestial-glow">
      <h2 className="celestial-title">About Celestial</h2>
      <p className="celestial-text">Celestial is a gaming cafe and e-commerce store where you can buy game time, games, and your favorite gaming snacks. Experience the cosmos while you play and shop!</p>
      <div className="celestial-stars"></div>
    </div>
  );
}

export default About;
